import React from 'react'
import {SideOverlay} from "../../../components/overlays/SideOverlay";

export const Aside = ({sideOpen, setSideOpen}) => {
    return (
        <aside className="hidden mt-8 w-96 bg-white border-l border-gray-200 overflow-y-auto lg:block">

            <SideOverlay open={sideOpen} setOpen={setSideOpen} />
        </aside>
    )
}
